import React from "react";
import { UserProps } from "../data/interfaces";

export default function MapUsers(props:UserProps) {
    return (
        <li className="imageBlock" key={`el-${props.Key}`}>
            <p>{props.name}</p>
            <p>{props.last_name}</p>
            <p>{props.city}</p>
            <p>{props.country}</p>
            <p>{props.books}</p>
        </li>
    )   
}
